import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom"
import Home from './navigate/home';
import Contact from './navigate/contact';
const App = () => {
  return (

      <BrowserRouter>
      <Routes>
        <Route to exact path = "" component = {Home}/>
        <Route to path = "/contact" component = {Contact}/>
      </Routes>
      </BrowserRouter>

  );
}

export default App;
